import Order from '../views/order.vue'
import Maintain from '../views/maintain.vue'
import {creatRouter, creatWebHistory} from 'vue-router'

const router = creatRouter({
    history: creatWebHistory(),
    routes: [
        {
            path: '/',
            // name: 'order',
            component: Order
        },
        {
            path: '/maintain',
            // name:'maintain',
            component: Maintain
        }
    ]
})
export default router
